    internal class GeographicRegions
    {
        public int GetGeographicRegionId(string provinceName, string cityName)
        {
            var geo = GetGeographicRegions();
            var id = geo.Join(
                geo,
                (province) => province.GeographicRegionId,
                (city) => city.ParentGeographicRegionId,
                (province, city) =>
                        new
                        {
                            CityId = city.GeographicRegionId,
                            ProvinceName = province.Name,
                            CityName = city.Name
                        })
                .Where(x => x.CityName == cityName && x.ProvinceName == provinceName)
                .Select(x => x.CityId).FirstOrDefault();

            return id;
        }

